It's time to celebrate the 74th Anuual Clam Festival here in Pismo Beach! We encourage you to visit between Oct. 10th through Oct. 24th to sample Pismo's participating restaurant's delicious clam chowder recipes. If you can’t come during this time, don’t worry because you can vote from your past tasting experiences at these popular restaurants! 

Link in bio to vote! Winner announced Monday October 26th!

